                style={{backgroundColor:color}}></div>
            <div className="bg-white w-4/5 fixed flex flex-wrap mx-[10%] justify-center bottom-12
            inset-x-0 px-2 gap-3">

                <button 
                    className="bg-red-500"
                >Red</button>
